const formatMessage = require('format-message');
const BlockType = require('../../extension-support/block-type');
const ArgumentType = require('../../extension-support/argument-type');
// const Cast = require('../../util/cast');

const blockIconURI = "data:image/png;base64,"

function isJson(string) {
    try {
        JSON.parse(string)
    } catch {
        return false
    }
    return true
}

/**
 * Class for TypeScratch
 * @constructor
 */
class typeScratch {
    constructor(runtime) {
        /**
         * The runtime instantiating this block package.
         * @type {Runtime}
         */
        this.runtime = runtime;
    }

    /**
     * @returns {object} metadata for this extension and its blocks.
     */
    getInfo() {
        return {
            id: 'typescratch',
            name: 'TypeScratch (Unfinished)',
            blockIconURI: blockIconURI,
            color1: '#3178c6',
            color2: '#235a97',
            blocks: [
                {
                    opcode: 'getType',
                    text: formatMessage({
                        id: 'typescratch.blocks.getType',
                        default: 'type [TYPE]',
                        description: 'Get a type.'
                    }),
                    disableMonitor: true,
                    blockType: BlockType.REPORTER,
                    arguments: {
                        TYPE: {
                            type: ArgumentType.STRING,
                            defaultValue: "Number",
                            menu: "genericTypes"
                        },
                    }
                },
                {
                    opcode: 'typeof',
                    text: formatMessage({
                        id: 'typescratch.blocks.typeof',
                        default: 'typeof [STRING]',
                        description: 'Get a type.'
                    }),
                    disableMonitor: true,
                    blockType: BlockType.REPORTER,
                    arguments: {
                        STRING: {
                            type: ArgumentType.STRING,
                            defaultValue: "string",
                        },
                    }
                },
                {
                    opcode: 'checkType',
                    text: formatMessage({
                        id: 'typescratch.blocks.checkType',
                        default: 'is [STRING] a [TYPE]?',
                        description: 'Checks if input matches a type.'
                    }),
                    disableMonitor: true,
                    blockType: BlockType.BOOLEAN,
                    arguments: {
                        TYPE: {
                            type: ArgumentType.STRING,
                            defaultValue: "String",
                            menu: "genericTypes"
                        },
                        STRING: {
                            type: ArgumentType.STRING,
                            defaultValue: "string",
                        }
                    }
                }
            ],
            menus: {
                genericTypes: {
                    acceptReporters: false,
                    items: 'getGenericTypeNames'
                },
                expandableTypes: {
                    acceptReporters: false,
                    items: 'getExpandableTypeNames'
                }
            }
        };
    }

    StaticTypes = {
        "Number": {
            show: true,
            compare: (value) => {return Number(value) == value && String(value) === ""}
        },
        "String": {
            show: true,
            compare: (value) => {return Number(value) != value && String(value) == value && !isJson(value)}
        },
        "List": {
            show: true,
            compare: (value) => {return /\[[\s\S]*\]/.test(value)}
        },
        "Array": {
            show: true,
            compare: (value) => {return /{[\s\S]*}/.test(value)}
        },
        "Null": {
            show: true,
            compare: (value) => {return [null, undefined, ""].includes(value)}
        },
        "Unknown": {
            show: false,
            compare: (value) => {return false}
        },
    }

    ExpandableTypes = {
        "Enum": {
            template: [],
            compare: (custom, value) => {custom.includes(String(value))}
        }
    }

    CustomTypes = {
        "TestEnum": {
            base: "Enum",
            value: ["foo", "bar"]
        }
    }


    _typeExists(name) {
        return (
            Object.keys(this.StaticTypes)
            .concat(Object.keys(this.ExpandableTypes))
            .concat(Object.keys(this.CustomTypes))
            .includes(name)
        )
    }


    getGenericTypeNames() {
        const statictypes = Object.keys(this.StaticTypes).filter((value) => this.StaticTypes[value].show === true)
        const customtypes = Object.keys(this.CustomTypes)
        return customtypes.concat(statictypes)
    }

    getExpandableTypeNames() {
        return Object.keys(this.ExpandableTypes).concat(Object.keys(this.CustomTypes))
    }

    getType(args, util) {
        return this.getGenericTypeNames().includes(String(args.TYPE)) !== undefined ? String(args.TYPE) : "Unknown"
    }

    typeof(args, util) {
        for (const name of Object.keys(this.CustomTypes)) {
            const type = this.CustomTypes[name]
            const base = this.ExpandableTypes[type.base]
            if (base.compare(type.value, args.STRING) == true) {
                return name
            }
        }
        for (const name of Object.keys(this.StaticTypes)) {
            const type = this.StaticTypes[name]
            if (type.compare(args.STRING) == true) {
                return name
            }
        }
        return "Unknown"
    }
    checkType(args, util) {
        return this.typeof(args.STRING) === this.getType(args.TYPE)
    }
}

module.exports = typeScratch;